import React from 'react';
import NavbarHeader from '../components/NavbarHeader';

import 'rbxhotfix/index.css';
import './index.css';

const Layout = props => (
  <div>
    <NavbarHeader />
    <div className='body-container'>{props.children}</div>
  </div>
);

export default Layout;
